    return(
      <DetailWrapper>
        <Header>揭秘：衡水中学学习方法</Header>
        <Content>
          <img src='https://upload-images.jianshu.io/upload_images/4259805-fabd73f3474fe42c.png?imageMogr2/auto-orient/strip|imageView2/2/w/600/format/webp'/>
          <p>想必只要是个高中生就没有不知道衡水中学的，想必衡水中学盛产学霸也是人尽皆知的事情，如今衡水中学学习方法公开，掌握这些方法，你也可以成为学霸！<br /></p>
        </Content>
      </DetailWrapper>
    )
  }

}

export default Detail;
